gU6(){return'The application of the Qur\u2019an Al Kareem is characterized by its approval of the edition of the King Fahd Complex for Printing the Noble Qur\u2019an in Madinah because of its reliability and mastery.\nThe Quran Al Kareem application is sponsored by the "Al-Heekmah Library".\nIt is a well-designed application that allows you to read interactively with the text of the electronic Quran, listen to recitations, study the  Quran Al Kareem and memorize it with ease.'},
gU7(){return"Among the most important features of the application :"},
gU8(){return"\u25c9 This application enables you to read the Quran as if you were reading in the Mus'haf, and you can read in vertical and horizontal mode.\n\u25c9 You can also read in variable mode that enables you to zoom in and out as you like.\n\u25c9 The application has the feature of textual search in the verses of the Qur\u2019an through real-time search and display of results with pages in addition to the possibility of going to the page as needed.\n\u25c9 Addition to bookmarks so that the reader can save the page and return to it whenever he wants.\n\u25c9 Addition to notes.\n\u25c9 Ability to listen to each verse in voice of different readers.\n\u25c9 The app allows interpretation for each verse, you can change between interpretations, and you can resize the interpretation line.\n\u25c9 Index of Surahs.\n\u25c9 Move between Surahs easily.\n\u25c9 The app lets you read the meaning of stop signs.\n\u25c9 The application enables you to read the Muslim fortress in full and divided by remembrance so that it is easy for the reader to navigate between sections, and you can add any mention to favorites.\n\u25c9 The application allows the reader to read to change color patterns, including the dark pattern, which changes the background color in black and white lines to give the reader complete comfort when reading in a low-light atmosphere."},
